import React from "react";
import study from "../assets/studybgg.jpg";

const Home = () => {
  return (
<>
<div className="parent">
    <img src={study}/>

<div className="headings">
<h1 className="heading-1">Rishav <span className="caste">Sachdeva</span></h1>
<h2 className="heading-2">Aspiring Student</h2>
<h5 className="quote">"Never stop chasing your dreams"</h5>
</div>
</div>
</>
  );
};


export default Home;
